Here's the Solidity contract code based on your description:

```solidity
pragma solidity 0.6.12;

contract MigrationContract {
    address private tokenReward;
    address private token2;
    address private token;
    address private token1;
    address[] public coins;
    uint256 private totalSupply;
    uint256 private locked = 0;

    function migrate() public payable {
        require(locked == 0, "Contract is locked");
        locked = 1;

        if (msg.value == 0 && address(this) != token) {
            (bool success,) = token.delegatecall(abi.encodeWithSignature("functionName(uint256,address)", 0x70a08231, msg.sender));
            require(success, "Failed to call external contract token");

            (bool success1, bytes memory data1) = token.call(abi.encodeWithSignature("transferFrom(address,address,uint256)", msg.sender, address(this), totalSupply));
            require(success1, "Failed to transferFrom");
            uint256 v1 = abi.decode(data1, (uint256));

            if (v1 > 0 && address(this) != tokenReward && block.timestamp + 0x15180 >= block.timestamp) {
                (bool success2,) = tokenReward.call(abi.encodeWithSignature("remove_liquidity(uint256,uint256,uint256)", totalSupply, block.timestamp + 0x15180, 0));
                require(success2, "Failed to remove liquidity");

                if (address(this) != coins[0] && address(this) != coins[1] && address(this) != token1) {
                    (bool success3,) = token1.delegatecall(abi.encodeWithSignature("functionName(uint256)", 0x18160ddd));
                    require(success3, "Failed to call external contract token1");
                }

                if (address(this) != token2) {
                    (bool success4,) = token2.call(abi.encodeWithSignature("add_liquidity(uint256,uint256,uint256)", totalSupply, totalSupply, 0));
                    require(success4, "Failed to add liquidity");

                    (bool success5,) = token1.delegatecall(abi.encodeWithSignature("functionName(uint256,address)", 0x70a08231, address(this)));
                    require(success5, "Failed to call external contract token1");

                    uint256 v4 = (99 * totalSupply) / 100;
                    if (v4 > ((99 * totalSupply) / 100)) {
                        (bool success6, bytes memory data6) = token1.call(abi.encodeWithSignature("transfer(address,uint256)", msg.sender, v4));
                        require(success6, "Failed to transfer");
                        uint256 v5 = abi.decode(data6, (uint256));

                        if (v5 > 0) {
                            locked = 0;
                        }
                    }
                }

                if (address(this) != coins[0]) {
                    (bool success7,) = coins[0].delegatecall(abi.encodeWithSignature("functionName(uint256,address)", 0x70a08231, address(this)));
                    require(success7, "Failed to call external contract coins[0]");

                    (bool success8,) = coins[0].call(abi.encodeWithSignature("YmCvE(address,uint256)", token2, totalSupply));
                    require(success8, "Failed to call function YmCvE");
                }

                if (address(this) != coins[1] && totalSupply > 0 && address(this) != token2) {
                    (bool success9,) = token2.delegatecall(abi.encodeWithSignature("functionName(uint256,uint256,uint256,uint256)", 0xed8e84f3, totalSupply, totalSupply, 1));
                    require(success9, "Failed to call external contract token2");
                }
            }
        }
    }
}
```

Please replace `"functionName(uint256,address)"`, `"functionName(uint256)"` and `"functionName(uint256,uint256,uint256,uint256)"` with the actual function names on the external contracts.

This code assumes that `totalSupply` is the value for `v0` in your description. If `v0` is a different variable, please replace `totalSupply` with the actual variable.
